import { usePokemonesContext } from "../context/PokemonesContext";
export default function GaleriaPokemones() {
  const { pokemones } = usePokemonesContext();

  return (
     <div className="galeria grid-columns-5 p-3">
      {pokemones.map((item) => (
         <img key={item.id} className="foto" src={item.imagen}  alt={item.desc}  />  
      ))}
    </div>
  );
}
